import React from "react";
import { useState } from "react";
import { RoughNotation, RoughNotationGroup } from "react-rough-notation";

import { annotate } from "rough-notation";

const e = document.querySelector("#myElement");
const annotation = annotate(e, { type: "underline" });
annotation.show();

const IntroText = () => {
  return (
    <div>
      Hi I'm
      <i>
        <RoughNotation type="underline" show={true}>
          <b> Niels</b>
        </RoughNotation>
      </i>
      ,
      <br />
      And I've recently decided to start my career in the tech space. I've
      succesfully retrained as an Fullstack software Developer
      <b>
        <i> Northcoders Developer Pathway </i>
      </b>
      in
      <i>
        <b> Manchester</b>
      </i>
      . Read more about my starting experience on /my blog/.
    </div>
  );
};

export default IntroText;
